import Vue from "vue";
import App from "./App.vue";
import router from "./router";
import store from "./store";  // Optional: Vuex store jika Anda menggunakannya

import axios from "axios";

// Set axios global
Vue.prototype.$axios = axios;
axios.defaults.baseURL = "http://localhost:8000/api";  // Sesuaikan dengan alamat backend Anda

Vue.config.productionTip = false;

new Vue({
  router,
  store, // Optional: Jika Anda menggunakan Vuex
  render: (h) => h(App),
}).$mount("#app");
